import React from "react";
import { useState } from "react";
import { useHistory } from "react-router";


require("./nav.css");

export default function Nav() {
  var [input, setInput] = useState("");
  var history = useHistory();
  //______________________________________________________
  function validate(value) {
    setInput(value.toLowerCase().replace(" ", ""));

    if (value.length > 3 && value.length <= 20) {
      var newValue = "";
      for (var i = 0; i < value.length; i++) {
        if (!parseInt(value[i])) {
          newValue += value[i];
        }
      }
      setInput(newValue);
    }
  }

  //______________________________________________________________submit
  function handleSubmit(e) {
    e.preventDefault();
    if (input === "") {
      alert("Ingrese nuevamente");
    } else {
      history.push(`/home/details/${input}`);
    }
  }
  //____________________________________________________________
  function createFactory(){
       history.push("/home/createActivity");
  }
  //___________________________________________________________________
  return (
    <header>
      <div className="div-nav">
        <form onSubmit={(e) => handleSubmit(e)}>
          <input
            className="input-nav"
            value={input}
            onInput={(e) => validate(e.target.value)}
          ></input>
          <button className="button-input-nav" type="submit">BUSCAR</button>
        </form>
        <div></div>
        <div>
          <h3>Crear actividad</h3>
          <button className="button-sear" onClick={()=>createFactory()}>CREAR</button>
        </div>
      </div>
    </header>
  );
}
